-- 导出  表 police_dog.t_dog_base 结构
CREATE TABLE IF NOT EXISTS `t_dog_base` (
  `id` int(11) NOT NULL auto_increment COMMENT 'id',
  `dog_name` varchar(128) default NULL COMMENT '犬名',
  `chip_no` varchar(128) default NULL COMMENT '芯片号',
  `chip_no_inject` date default NULL COMMENT '芯片注入日期',
  `sex` int(2) default NULL COMMENT '性别（1：公，2：母）',
  `birthday` date default NULL COMMENT '出生日期',
  `breed` varchar(64) default NULL COMMENT '犬品种',
  `dog_source` varchar(128) default NULL COMMENT '来源',
  `dog_colour` varchar(16) default NULL COMMENT '毛色',
  `hair_type` varchar(16) default NULL COMMENT '毛型',
  `dog_type` int(2) default NULL COMMENT '类型（1：工作犬，2：非工作犬）',
  `dog_level` int(2) default NULL COMMENT '犬种等级（1、2、3）',
  `inbreeding` varchar(16) default NULL COMMENT '近交系数',
  `tutor` varchar(32) default NULL COMMENT '训导员',
  `breeder` varchar(32) default NULL COMMENT '繁育员',
  `train_score` varchar(8) default NULL COMMENT '复训成绩（优秀、合格、不合格）',
  `next_train_date` date default NULL COMMENT '下次复训时间（yyyy-mm-dd）',
  `work_place` varchar(128) default NULL COMMENT '工作单位（与人员信息关联自动生成）',
  `work_area` varchar(128) default NULL COMMENT '所属片区',
  `work_province` varchar(128) default NULL COMMENT '省区市',
  `file_no` varchar(32) default NULL COMMENT '警犬档案号',
  `create_doc_date` date default NULL COMMENT '建档日期（YYYY-MM-dd）',
  `dog_photo` varchar(128) default NULL COMMENT '外貌特征（照片）',
  `nest_no` varchar(50) default NULL COMMENT '窝编号',
  `father_id` varchar(255) default NULL COMMENT '父亲id',
  `mother_id` varchar(255) default NULL COMMENT '母亲id',
  `growth_stage` int(2) default NULL COMMENT '成长阶段（1：幼犬，2：成犬）',
  `work_stage` int(2) default NULL COMMENT '工作状态（1：待申领，2：已被申领，3：被淘汰，4：死亡）',
  `belonging` varchar(255) default NULL COMMENT '淘汰/退休归属',
  `creation_date` date default NULL COMMENT '数据创建日期',
  `last_update_date` date default NULL COMMENT '最后修改日期',
  PRIMARY KEY  (`id`),
  KEY `nest_no` (`nest_no`),
  KEY `father_id` (`father_id`),
  KEY `mother_id` (`mother_id`),
  KEY `chip_no` (`chip_no`)
) ENGINE=InnoDB AUTO_INCREMENT=356 DEFAULT CHARSET=utf8;

